import React from "react";
import { useState } from "react";


const tabs = [
    {
      key: '0',
      title: 'tab1',
      content: 'content 1'
    },
    {
      key: '1',
      title: 'tab2',
      content: 'content 2'
    },
    {
      key: '2',
      title: 'tab3',
      content: 'content 3'
    }
]


function SubTabs(props) {

    const [activeBar, setActiveBar] = useState('0')
    return (  
        <React.Fragment>
        <div>
            {tabs.map(tab => {return(
                <button key={tab.key} onClick={setActiveBar(tab.key)}>{tab.title}</button>
            )})}
        </div>
        <div></div>
        </React.Fragment>
    );
}

export default SubTabs;
